                 var ticketEntities = genericBEManager.GetAllGenericBusinessEntities(new Guid("bbfa17ed-b670-475b-9b2c-560ddc808c4d"), 
                                                                                                                                                                            neededColumns, filterGroup);

                 GetCaseTicketInfos ticketInfos = new CRMFixedOper.GetCaseTicketInfos { Tickets = new List<TicketInfo>() };

                  if(ticketEntities != null)
		  {
			foreach(var ticketEntity in ticketEntities )
		       {
                                var id = (long) ticketEntity.FieldValues["ID"];
				if(id == ticketId) 
				   continue;

				var  completedTime  = ticketEntity.FieldValues["CompletedTime"];
				var completedBy = ticketEntity.FieldValues["CompletedBy"];
				var freeNotes= ticketEntity.FieldValues["FreeNotes"];

				var ticketInfo = new TicketInfo();
				 ticketInfo.ID = id;
				 ticketInfo.Title= ticketEntity.FieldValues["Title"].CastWithValidate<string>("Title") ;
				 ticketInfo.TicketType=  (int)  ticketEntity.FieldValues["TicketType"];
				 ticketInfo.CreatedTime =(DateTime) ticketEntity.FieldValues["CreatedTime"];
                                 ticketInfo.CompletedTime= completedTime; // != null ? (DateTime) completedTime : null;
				 ticketInfo.Notes =  freeNotes != null ? (string) freeNotes : null;
				 ticketInfo.CompletedBy = completedBy; // != null ? (int) completedBy : null;

				 ticketInfos.Tickets.Add(ticketInfo);
                        }
                   }       

                 return ticketInfos.Tickets != null && ticketInfos.Tickets.Count > 0 ? ticketInfos : null;
   }

}

